### **6.10.1 Computing spatio-temporal KDE**

Now, the STKDE will be derived by using h and lambda values derive in previous step.


::: {.cell}

```{.r .cell-code}
kde_yday <- spattemp.density(
  fire_yday_owin,
  h = 9000,
  lambda = 19)
